import React, { Component } from 'react';

class LoginPage extends Component {
    state = { 
        email:'',
        password:''
     }
    render() { 
        return ( 
            <div>
                <h1>Login page</h1>
                <form>
                    <label>Email
                    <input type="text" name="email" />
                    </label>
                    <br />
                    <label>Password
                    <input type="password" name="password" />
                    </label>
                    <br />
                    <button>Login</button>
                </form>
            </div>
         );
    }
}

export default LoginPage;
